$(function(){obj={log_server_update:function(){var e=Strack.validate_form("log_setting");200===parseInt(e.status)&&$.ajax({type:"POST",url:LogServerPHP.updateLogServerConfig,data:e.data,dataType:"json",beforeSend:function(){$.messager.progress({title:StrackLang.Waiting,msg:StrackLang.loading})},success:function(e){$.messager.progress("close"),200===parseInt(e.status)?Strack.top_message({bg:"g",msg:e.message}):layer.msg(e.message,{icon:7,time:1200,anim:6})}})}},$.ajax({type:"POST",url:LogServerPHP.getLogServerConfig,dataType:"json",success:function(e){for(var a in e)$("#set_"+a).val(e[a])}})});